DISTANCE_PER_TICK = np.pi*0.07/135

ctl = 0
ctr = 0
ptl = left_pid[0]
ptr = right_pid[0]
ntheta = 0
xt = 0
yt = 0
xs = []
ys = []

for i in range(1, min(len(left_pid), len(right_pid))):
    if left_pid[i] == 2:
        print(i)
    ctl = left_pid[i]
    ctr = right_pid[i]

    dl = (ctl - ptl) * DISTANCE_PER_TICK
    dr = (ctr - ptr) * DISTANCE_PER_TICK

    d = (dl+dr)/2
    thetha = (dl-dr)/0.16
    
    xt += d*math.cos(ntheta + thetha/2)
    yt += d*math.sin(ntheta + thetha/2)
    ntheta += thetha

    xs.append(xt)
    ys.append(yt)

    ptl = left_pid[i]
    ptr = right_pid[i]


plt.plot(xs,ys)
plt.title("Robot Trajectory moving on a straight line")
plt.xlabel("x position (m)")
plt.ylabel("y position (m)")

plt.show()